	(14, 1, 14, 'Listening Section', 1, '<p>On September 13<sup>th</sup> 1961</p>', '<p>On November 33<sup>rd</sup> 1961</p>', '<p>On December 3<sup>rd</sup> 1981</p>', '<p>On September 3<sup>rd</sup> 1961</p>', '<p>On September 3<sup>rd</sup> 1981</p>', 'D', '12_14_1.mp3', '', '', '', '', '', ''),
	(15, 1, 15, 'Listening Section', 1, '<p>In 1981</p>', '<p>In 1982</p>', '<p>In 1983</p>', '<p>In 1984</p>', '<p>In 1985</p>', 'A', '12_15_1.mp3', '', '', '', '', '', ''),
	(16, 1, 16, '<p>Dizzy, tired and fed up. It has been three years I&rsquo;m hiding my sickness. Now I&rsquo;m beat, but I still need to go to school and try to take the lessons. My best friend asked me, &ldquo;I&rsquo;m okay, only tired&rdquo;.</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; I didn&rsquo;t go home. I attended an extra curricular activity. When I gathered with my friends, my chest was hurting, &ldquo;Oh my God, Why do I need to feel this suffering everyday? I just want to hang out together with my friends, my family, everybody &hellip; I don&rsquo;t want my best friends know this&rdquo;.</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Talking of the devil, my best friend was waiting for me by the front gate. I then went home with him, but then suddenly my body was trembling, my head was spinning, and blood to sorting out from my nose. I fainted unconsciously, and was brought to hospital by my best friend.</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Before informing my parents, I asked the doctor and he said. &ldquo;You are suffering a heart cancer. Your heart is continuously getting weaker, and I&rsquo;m afraid you can&rsquo;t hold much longer. We must conduct a surgery as soon as possible.&rdquo;</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; I took my cell phone and called my parents. Then soon arrived at the hospital; arriving in the state of shock and pity on my condition, with all the life sustaining equipments stuck on my body.</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; One week has passed, and I&rsquo;ve been unconscious for I went into a coma. Everyday, my friends watched over me. They even brought me some food, &ldquo;We made that for you.&rdquo; they said.</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Then finally my parents agreed to conduct the surgery. They hoped for the best because they knew that God is still kind to me.</p>\n<p>What is the purpose of the text?</p>', 1, '<p>To tell the readers about an extra curricular activity</p>', '<p>To inform the readers about suffering a heart cancer</p>', '<p>To persuade the readers in order to hold a heart surgery</p>', '<p>To inform the readers about saving patients with a heart cancer</p>', '<p>To tell the readers about the writer&rsquo;s experience with his sickness</p>', 'E', '', '', '', '', '', '', ''),
	(17, 1, 17, '<p>From the text we know that the writer &hellip;.</p>', 1, '<p>had just had a heart surgery</p>', '<p>waited for his friends in the hospital</p>', '<p>fainted unconsciously in the hospital</p>', '<p>told his parents to stay in the hospital</p>', '<p>has just known that he had serious illness</p>', 'A', '', '', '', '', '', '', ''),
	(18, 1, 18, '<p>To: Danisha</p>\n<p>&nbsp;</p>\n<p>I will be glad if you could come to my 17<sup>th</sup> &nbsp;birthday party, we will have dinner together with our classmate on March 27<sup>th</sup> &nbsp;2018 at 7 p.m. to 10 p.m.</p>\n<p>&nbsp;</p>\n<p>Delisha</p>\n<p>When was Delisha born?</p>', 1, '<p>March 27<sup>th</sup> 2018</p>', '<p>March 27<sup>th</sup> 2000</p>', '<p>March 27<sup>th</sup> 2001</p>', '<p>March 17<sup>th</sup> 2010</p>', '<p>March 17<sup>th</sup> &nbsp;2001</p>', 'C', '', '', '', '', '', '', ''),
	(19, 1, 19, '<p>To,<br />Atrianto Faot<br />Managing director<br />Charlie Juices Limited<br />Kuanino, Kupang, East Nusa Tenggara<br /><br />Date: 23<sup>rd</sup> of February 2018<br />Subject: marketing proposal letter<br /><br />Respected Sir,<br /><br />I, Markus Banunut, the marketing head at MB Marketing services am writing this letter to you on behalf of my company so as to propose to you a marketing plan that we have designed for the marketing and promotion of your Juice Brand. This plan is directed towards existing customers as well as new prospective customers.<br />We aim to divide the plan in three steps, lasting 4 months each for the next 12 months. The first phase will focus on newspaper, magazine and online marketing; the second phase will focus on banner advertising whereas the third phase will concentrate on TV advertisements. The estimated budget for the entire marketing plan is $50000 and by the end of 1 year, we are expecting about 25% rise in sales if the plan works as per forecasted.<br />If you agree to this plan, then we can conduct a meeting to discuss its details. If you need any changes or amendments, feel free to contact us either by replying or by calling us.<br /><br />Thanking you<br />Yours sincerely,<br /><br />Markus Banunut</p>\n<p>What is proposed by the marketing head of MB Marketing?</p>', 1, '<p>A meeting discussion</p>', '<p>A business forecast</p>', '<p>A financial offer</p>', '<p>A marketing plan</p>', '<p>A design</p>', 'D', '', '', '', '', '', '', ''),
	(20, 1, 20, '<p>The estimated budget for the <u>entire</u> marketing plan</p>\n<p>The underlined word has the closest to ... .</p>', 1, '<p>Apart</p>', '<p>A half</p>', '<p>Whole</p>', '<p>A quarter</p>', '<p>One of</p>', 'C', '', '', '', '', '', '', ''),
	(21, 1, 21, '<p>Spiders are predatory invertebrate animals. They are not classified in the class of insects. A spider has eight legs while an insect never has more than six legs.</p>\n<p>Spiders have a body with two main divisions, four pairs of walking legs and two other pairs of abdominal spinnerets for spinning threads of silk. This silk can be used to aid climbing, build egg sacs and catch prey.</p>\n<p>Spiders kill so many insects, but they never do the least harm to man&rsquo;s belongings. Spiders are busy for at least half of the year killing insects. It is impossible to find out insects trying to kill, since they are hungry creatures, which cannot be contented with only three meals a day.</p>\n<p>The text tells us about .&hellip;</p>', 1, '<p>many kinds of insects killed by the spider</p>', '<p>the factual information about spider</p>', '<p>the two main divisions of spider</p>', '<p>the classification of spiders</p>', '<p>the hungry creatures</p>', 'B', '', '', '', '', '', '', ''),
	(22, 1, 22, '<p>Why can&rsquo;t spiders be classified in the class of insects? Because ...</p>', 1, '<p>their bodies have two main divisions</p>', '<p>they eat more than three meals a day</p>', '<p>they have more than six legs</p>', '<p>they have walking legs</p>', '<p>kill many insects</p>', 'C', '', '', '', '', '', '', ''),
	(23, 1, 23, '<p>What is the use of threads of silk in spiders? It is used for &hellip;.</p>', 1, '<p>classifying the insects</p>', '<p>spinning and dividing preys</p>', '<p>walking and hiding their preys</p>', '<p>dividing insects into two parts</p>', '<p>climbing, building egg sacs and catching prey</p>', 'E', '', '', '', '', '', '', ''),
	(24, 1, 24, '<p>They never do the least <u>harm</u> to man&rsquo;s belonging&rdquo;</p>\n<p>The underlined word is closest in meaning to &hellip;.</p>', 1, '<p>command</p>', '<p>damage</p>', '<p>relation</p>', '<p>pleasure</p>', '<p>&nbsp;intervention</p>', 'B', '', '', '', '', '', '', ''),
	(25, 1, 25, '<p>... you a light snack and <u>beverage</u></p>\n<p>The underlined word has the closest meaning to ...</p>', 1, '<p>Desert</p>', '<p>Drink</p>', '<p>Food</p>', '<p>Cuisine</p>', '<p>Fruit</p>', 'B', '', '', '', '', '', '', ''),
	(26, 1, 26, '<p><strong>The text is for question number&nbsp; 2</strong><strong>7</strong><strong> - </strong><strong>30</strong></p>\n<p>The Crocodile Story (A Legend of Timor Island)</p>\n<p>Many years ago a little crocodile lived in a swamp in a far away place. He dreamed of becoming a big crocodile but, as food was scarce, he became weak and grew sadder and sadder.<br />He left for the open sea, to find food and realise his dream, but the day became increasingly hot and he was still far from the seashore. The little crocodile &ndash; rapidly drying out and now in desperation &ndash; lay down to die.</p>\n<p>A little boy took pity on the stranded crocodile and carried him to the sea. The crocodile, instantly revived, was grateful.</p>\n<p>&nbsp;&ldquo;Little boy, you have saved my life. If I can ever help you in any way, please call me. I will be at your command&rdquo; he said.</p>\n<p>A few years later, the boy called the crocodile, who was now big and strong.</p>\n<p>&ldquo;Brother Crocodile, I have a dream too. I want to see the world&rdquo;.</p>\n<p>&ldquo;Climb on my back and tell me which way you want to go&rdquo; the Crocodile answered.</p>\n<p>&ldquo;Follow the sun&rdquo;, said the boy.</p>\n<p>The crocodile set off for the east, and they traveled the oceans for years, until one day the crocodile said to the boy,</p>\n<p>&ldquo;Brother, we have travelled for a long time. But now the time has come for me to die. In memory of your kindness, I will turn myself into a beautiful island, where you and your children can live until the sun sinks in the sea&rdquo;.</p>\n<p>As the crocodile died, he grew and grew, and his rigid back became the mountains and his scales the hills of Timor. Now when the Timor people swim in the ocean, they enter the water saying &ldquo;Don&rsquo;t eat me crocodile, I am your relative&rdquo;.</p>\n<p>Why did the Crocodile leave for the open sea?</p>', 1, '<p>He wanted to find food and realise his dream</p>', '<p>He wanted to look for some water</p>', '<p>He wanted to see his relatives</p>', '<p>He wanted to live in a seashore</p>', '<p>He wanted to sea the sun</p>', 'A', '', '', '', '', '', '', ''),
	(27, 1, 27, '<p>How would the Crocodile pay the little boy kindness?</p>', 1, '<p>He would give the boys some food</p>', '<p>He would obey the boy&rsquo;s command</p>', '<p>He would return himself into an island</p>', '<p>He would fulfill all the boy&rsquo;s request</p>', '<p>He would carry the boy to travel</p>', 'B', '', '', '', '', '', '', ''),
	(28, 1, 28, '<p>A little boy took pity on the stranded crocodile and <u>carried</u> him to the sea.</p>\n<p>The underlined word has the closest meaning to ... .</p>', 1, '<p>cared</p>', '<p>scared</p>', '<p>bought</p>', '<p>brought</p>', '<p>caught</p>', 'D', '', '', '', '', '', '', ''),
	(29, 1, 29, '<p>What can we learn from the story?</p>', 1, '<p>We must be helpful and maintain the friendship</p>', '<p>We must have a dream to travel the world</p>', '<p>We must memorize other&rsquo;s kindness</p>', '<p>We must follow other&rsquo;s command</p>', '<p>We must care the animals</p>', 'A', '', '', '', '', '', '', ''),
	(30, 1, 30, '<p><strong>The following text is for questions </strong><strong>31 to 34.</strong></p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Nobody likes paying taxes. Even those who know that taxation is necessary and reluctant to pay taxes. It is not pleasant to see part of your monthly income taken away from your income tax. Ignorant people think this is injustice and make grievance of it.</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Every country has a government. The primary duties of a government are to protect the life and property of the citizens, to <u>maintain</u> law and order, and settle dispute between citizens in a just and orderly way through the law-courts, to defend the country from foreign foes and to maintain and direct education, provide hospitals for the sick and attend to sanitation. All these great to be kept up and have to be paid.</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Furthermore, schools and teachers have to be provided and supported, health experts and sanitary engineers have to be employed. Now where is all from? Tax is needed for the benefits of the public. It is the people as a whole rich and poor that benefit by security of the life and property, by the sound roads, by public hospital, public school and good sanitation.</p>\n<p>Therefore, it is necessary for people to pay taxes. The money will be back to them in the form of public service and facility.</p>\n<p>The topic of the text is about &hellip;.</p>', 1, '<p>the description of taxes</p>', '<p>the way people pay taxes</p>', '<p>the necessity of paying taxes</p>', '<p>the objection of paying taxes</p>', '<p>the facilities to pay taxes</p>', 'C', '', '', '', '', '', '', ''),
	(31, 1, 31, '<p>Based on the text we know that &hellip;</p>', 1, '<p>defending country from foes is not the job of the government</p>', '<p>it is pleasant to give your money income to pay taxes</p>', '<p>government has a simple duty to handle its people</p>', '<p>ignorant people think it is necessary to pay taxes</p>', '<p>some people think paying taxes is injustice</p>', 'E', '', '', '', '', '', '', ''),
	(32, 1, 32, '<p>What is the main idea of paragraph three?</p>', 1, '<p>Tax is needed for the public&rsquo;s benefit</p>', '<p>Government should maintain good roads</p>', '<p>Good sanitation is necessary for the public</p>', '<p>Both rich and poor people have to pay taxes</p>', '<p>Government should provide good school and sanitary facilities</p>', 'A', '', '', '', '', '', '', ''),
	(33, 1, 33, '<p>The underlined word in sentence, &ldquo;...to <u>maintain</u> law and order, and settle dispute between citizens..&rdquo; (paragraph 2) has the same meaning as...</p>', 1, '<p>violate</p>', '<p>introduce</p>', '<p>preserve</p>', '<p>reform</p>', '<p>revise</p>', 'C', '', '', '', '', '', '', ''),
	(34, 1, 34, '<p><strong>The text is for question number </strong><strong>3</strong><strong>5 and </strong><strong>3</strong><strong>7.</strong></p>\n<p>&nbsp;</p>\n<p>In July 2016, Indonesian government executed some criminals. There were drug paddlers who had been sentenced to death. They were executed in Nusa Kambangan by firing squad. This provoked arguments in society. Some people agree with capital punishment but others hardly oppose it.</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; On one hand, death sentence is believed to be an effective tool for law enforcement as it reduces crime. It is also cheaper than life imprisonment. The punishment guarantees those who committed horrendous crime will never have the opportunity to cause future tragedies.</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; On the other hand, there are people oppose the death penalty. They state that death sentence has known significant effect of on crime. It only gives the government the power to take people&rsquo; lives, and it could also potentially cause social injustices by intentionally targeting people of color which I racist. People who are not able to pay good attorneys may also be the target of this punishment. They suggest that life imprisonment is more appropriate.</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The death penalty will always have its pros and cons. Some people think that it is a very effective way to reduce crime. However others argue that this punishment can lead to social injustices. &nbsp;</p>\n<p>The text is about &hellip; .</p>', 1, '<p>Greatest criminal</p>', '<p>Ethics of capital punishment</p>', '<p>Fighting against drug paddlers</p>', '<p>Death penalty abolition</p>', '<p>An argument about capital punishment</p>', 'E', '', '', '', '', '', '', ''),
	(35, 1, 35, '<p>People do not agree with the death penalty because &hellip; .</p>', 1, '<p>The punishment will potentially create social injustice</p>', '<p>There are no guarantees about neutrality of officers</p>', '<p>It is an important tool for law enforcement</p>', '<p>The death penalty will always create crime</p>', '<p>It will be very effective for crime deterrence</p>', 'A', '', '', '', '', '', '', ''),
	(36, 1, 36, '<p><strong>The text is for question number 3</strong><strong>8</strong><strong> and </strong><strong>40</strong></p>\n<p style="text-align: center;"><strong>Greenhouse Effect</strong></p>\n<p>When fossil fuels, or other fuels, such as wood or peat, which contain carbon are burned, carbon dioxide is released into the atmosphere. Vehicles also give out, and so add, carbon dioxide to the atmosphere.</p>\n<p>The Earth&rsquo;s atmosphere allows most of the Sun&rsquo;s rays to pass through it to heat the Earth&rsquo;s surface. The Earth reflects much of the heat energy back into the atmosphere, but much of this reflected radiation cannot escape because gases such as carbon dioxide absorb it. They grow warm and send heat radiation back to Earth. This is the greenhouse effect. Many scientists think that the greenhouse effect may change the climate, over the next 100years or so. One consequence of soalled "global warming" resulting from the greenhouse effect could be melting of the polar ice - caps. This in turn, could lead to a rise in sea level which could flood large areas of highly populated coastal land.</p>\n<p>If carbon dioxide proves to be as harmful as thought. In order to reduce carbon dioxide levels we need to reduce the amounts of carbon-rich fuels burned.</p>\n<p>Taken from Kingfisher Science Encyclopedia, 1997</p>\n<p>What causes the Earth become warmer?</p>', 1, '<p>The heat radiation sent back to Earth by gases that grow warm</p>', '<p>The Sun&rsquo;s rays reflected by the Earth into the atmosphere</p>', '<p>Reflected radiation that escapes into the atmosphere</p>', '<p>The burning of wood or peat</p>', '<p>melting of the polar ice &ndash; caps</p>', 'A', '', '', '', '', '', '', ''),
	(37, 1, 37, '<p>What will happen if the sea level rises?</p>', 1, '<p>The polar ice will melt and make the sea get cooler</p>', '<p>Some large areas of coastal land will be dried up</p>', '<p>Some large areas of coastal land will be inundated</p>', '<p>The surface of the Earth will be flooded with water</p>', '<p>The polar ice will melt and make the sea get warmer</p>', 'C', '', '', '', '', '', '', ''),
	(38, 1, 38, '<p>If carbon dioxide proves to be as <strong><u>harmful</u></strong> as thought&hellip;( paragraph 3). The underline word has the same meaning to &hellip;</p>', 1, '<p>Useful</p>', '<p>Helpful</p>', '<p>Inoffensive</p>', '<p>Dangerous</p>', '<p>Harmless</p>', 'D', '', '', '', '', '', '', ''),
	(39, 1, 39, '<p>Who is announcing?</p>', 1, '<p>Pilot</p>', '<p>Co-pilot</p>', '<p>Cabin crew</p>', '<p>Passenger</p>', '<p>Air traffic control officer</p>', 'A', '', '', '', '', '', '', ''),
	(40, 1, 40, '<p>What do the opposing people suggest as an alternative to the death penalty?</p>', 1, '<p>Moving criminals to remote islands</p>', '<p>Providing good attorneys</p>', '<p>Social punishment</p>', '<p>Joining a fire squad</p>', '<p>Life imprisonment</p>', 'E', '', '', '', '', '', '', ''),
	(41, 1, 1, '<p>Rearrange the following sentences to form a meaningful paragraph!</p>\n<ol>\n<li>He won his first tournament just days before his 18th birthday</li>\n<li>Bjorn Rune Borg was born on June, 1956 in Stockholm, Sweden.</li>\n<li>He dropped out of school to devote himself to training fulltime when he was 13 years Old</li>\n<li>At the age of 11, he won his first tennis tournament</li>\n<li>Borg qualified for the Swedih Davis up tea, at age 15 and won both of his single matches</li>\n</ol>', 2, '', '', '', '', '', '', '', '', '', '', '', '', ''),
	(42, 1, 2, '<p><strong>The text is for question number 42- 45</strong>.</p>\n<p style="text-align: center;"><strong>SHOULD NOT BRING MOBILE PHONE TO SCHOOL</strong></p>\n<p>Recently most people own mobile phone. Why does mobile phone user increase dramatically in recent years? First, the feature and functions has increased. Mobile phone is not used just for calling for but sending text, taking pictures, recording videos, accessing internet, playing games and much more. Second, mobile phone has also become a lot cheaper. Now this communication device doesn&rsquo;t only fill the pocket of adult but also teenager and student. Even a lot phones are internationally designed to teenaged market. However should they be allowed to bring them to school?</p>\n<p>Many schools don&rsquo;t allow students to bring cell phone to school. It&rsquo;s very reasonable because bringing phone to school potentially disturbs the learning process. Most students use cell phone irresponsibly. They use cell phones to talk to their friend during class as well. It potentially leads less concentration in the time of learning and teaching process.</p>\n<p>Students go to school&nbsp;to learn and behave fair way. Mobile phones provide a large temptation to cheat in tests. They can communicate to anyone and almost anywhere in the world. Because of the small size of the cell phone, students can send a text quietly and discreetly. The text can go unnoticedanywhere to get help in answering tests, homework, and other class assignment. Learning in school is to behave fair not cheating.</p>\n<p>Therefore, school should ban student from bringing their cell phone. However it should be done fairly. In case an emergency some student need a call for help, providing easy access to phone is better.</p>\n<p><em>Takenfrom: triafebrilia-fl.blogspot.com</em></p>\n<p>Why does mobile phone users increase in recent years?</p>', 2, '', '', '', '', '', '', '', '', '', '', '', '', ''),
	(43, 1, 3, '<p>Why does mobile phones make students less concentration during class?</p>', 2, '', '', '', '', '', '', '', '', '', '', '', '', ''),
	(44, 1, 4, '<p>How does the students cheat by using mobile phones?</p>', 2, '', '', '', '', '', '', '', '', '', '', '', '', ''),
	(45, 1, 5, '<p>What is the writer&rsquo;s recommendation?</p>', 2, '', '', '', '', '', '', '', '', '', '', '', '', '');
